import React from "react";

// const Expense = React.lazy(() => import("../Expense"));
// const Expenses = React.lazy(() => import("../pages/Expenses"));
// const WrapperView = React.lazy(() => import("../WrapperView"));
const Countries = React.lazy(() => import("../pages/Countries"));
const WrapperForm = React.lazy(() => import("../WrapperForm"));
const ProvinseForm = React.lazy(() => import("../pages/ProvinseForm"));
const PrvnTable = React.lazy(() => import("../../component2/PrvnTable"));

const Routes = [
  {
    path: "/countries",
    exact: true,
    component: Countries
    // component: PrvnTable
  },

  {
    path: "/countries/:id/edit",
    exact: true,
    component: (props) => < WrapperForm edit={true} type={"countries"} />
  },

  {
    path: "/countries/new",
    exact: true,
    component: < WrapperForm type={"countries"} />
  },
  {
    path: "/provinces",
    exact: true,
    component: PrvnTable
  },

  {
    path: "/provinces/:id/edit",
    exact: true,
    component: (props) => < WrapperForm edit={true} />
  },

  {
    path: "/provinces/new",
    exact: true,
    component: WrapperForm
  },

  {
    path: "/cities/new",
    exact: true,
    component: ProvinseForm
  },

  {
    path: "/cities/:id/edit",
    exact: true,
    // component: PrvnTable
  },

  // {
  //   path: "/tolls/:id/view",
  //   exact: true,
  //   // component: (props) => <WrapperView expenseType={"tolls"} edit={true} {...props} />
  // },

  // {
  //   path: "/tolls/:id/edit",
  //   exact: true,
  //   // component: (props) => <TollEdit edit={true} {...props} />
  // },


];
export default Routes;
